import Header from './components/Header'
import Tasks from './components/Tasks'

function App() {

  const [tasks, setTasks] = useState([
    {name:"Dentist", id:1},
    {name:"School", id:2},
    {name:"Homework", id:3}
])
  return (
    <div className="container">
     <Header title="Task Tracker"/>
     <Tasks tasks={tasks}/>

    </div>
  );
}

export default App;
